import React from 'react';
import styled from 'styled-components';
import {} from 'styled-components/cssprop';
import { NAV_HEIGHT, CONTENT_WIDTH } from '../../data';
import { useSelector } from 'react-redux';

interface Props {}
function stuc<T>(El: string = 'div') {
  type PropType = T & { children?: JSX.Element[]; className?: string };
  return (props: PropType) => (
    <div className={props.className}>{props.children}</div>
  );
}
const IUpperNav = stuc<{ customProp?: boolean }>();
const UpperNav = styled(IUpperNav)`
  border: red solid 1px;
  height: ${NAV_HEIGHT};
  width: 100%;
  position: absolute;
  top: ${props => (props.topNavDisplay ? '0' : '-100%')};
`;

const Container = styled.div`
  height: 100%;
  width: 100%;
  max-width: ${CONTENT_WIDTH}; /*For margins*/
  margin: auto; /*For margins*/
  display: flex;
  align-items: center;
  justify-content: space-between;
  border: green solid 1px;
  box-sizing: border-box;
`;

const Nav: React.FC<Props> = () => {
  interface RootState {
    topNavDisplay: boolean;
  }
  const selectTopNavDisplay = (state: RootState) => state.topNavDisplay;
  let topNavDisplay = useSelector(selectTopNavDisplay);
  return (
    <UpperNav topNavDisplay={topNavDisplay}>
      <Container>
        <div>nav Bar</div>
        <div>nav Bar</div>
      </Container>
    </UpperNav>
  );
};

export default Nav;
